import React from 'react'

const RemovedSquaredImg = props => {

    let content = (
        <div>
            <div className="relative w-full bg-yellow-300 pb-1/1">
                <img className="absolute w-full h-full object-cover" src={props.data.images[0].path} />
                <button className="absolute top-0 right-0 h-10 w-10 m-2">X</button>
            </div>
        </div>
    )

    return content
}

export default RemovedSquaredImg
